import React from 'react';

class NewArrivals extends React.Component {
	render(){
		return (
			<div>
				<h2>New Arrivals</h2>
				<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry</p>
			</div>
		)
	}
}

export default NewArrivals;
